import './App.css';
import React, { Component } from 'react';


class App extends Component {

  constructor() {
      super();

      this.state = {
          users: []
      }
  }
  payload = [{
    "filter":{},
    "ignoreAssociation": true,
    "isPaginateDB": true,
    "modelType": "journals",
    "page": 1,
    "pageSize": 10,
  }
  ]
  async componentDidMount() {
    await fetch('http://o-research-dev.orlab.com.vn/api/v1/swagger/index.html#/filter-manager-apis/post_filters_filter_',this.payload)
        .then(res => res.json())
        .then((data) => {
            this.setState({ users: data })
        })
        .catch(console.log)
  }

  renderUsers = () => {
      let users = this.state.users.map((data, index) =>
          <tr key={data.id}>
            <td>{data.id}</td>
            <td>{data.name}</td>
            <td>{data.email}</td>
            <td>{data.website}</td>
          </tr>
      );

      return users;
  }

  render() {
    return (
      <div className="App">
        <div className="container">
          <h1 className="text-center">Users List</h1>

          <table className="table">
            <thead>
              <tr>
                <th>#</th>
                <th>Name</th>
                <th>Email</th>
                <th>Website</th>
              </tr>
            </thead>
            <tbody>
              {this.renderUsers()}
            </tbody>
          </table>

        </div>
      </div>
    );
  }
}

export default App;
